INSERT INTO `citta` (`id`, `nome`, `info`, `descrizione`, `immagine`) VALUES
(1, 'Bari', 'premi 1 per ascoltare', 'Bari è il capoluogo della regione Puglia, una città che si affaccia sul mare, conosciuta per il suo centro storico (“Bari Vecchia”), il lungomare e il porto, il Castello Svevo e per la basilica di San Nicola, in cui sono conservate le reliquie del santo. La città è un ponte tra il cristianesimo cattolico e quello ortodosso. Nel centro città risiede il Teatro Petruzzelli, quarto più grande di Italia. Bari è sempre stata una città marittima e fin dal passato ha avuto contatti con il Medio Oriente. Dal 1930, si tiene la Fiera del Levante, una delle più importanti esposizioni fieristiche d’Italia. Bari è sede dell’Università degli Studi e del Politecnico. In foto vi è la Basilica di San Nicola in primo piano, mentre sullo sfondo vi è uno squarcio del mare Adriatico barese.', );
INSERT INTO `citta` (`id`, `nome`, `info`, `descrizione`, `immagine`) VALUES
(2, 'Lecce', 'premi 2 per ascoltare', 'Lecce è uno dei capoluoghi della Puglia, situata nell’area centrale del Salento. Ha origini messapiche molto antiche e ha diversi resti della dominazione romana che la inseriscono tra le città d’arte d’Italia. Lecce si distingue per il barocco delle chiese e dei palazzi, costruiti in pietra leccese, adatta alla lavorazione con lo scalpello. La cura delle sue architetture, soprattutto durante il Regno di Napoli, diede vita al “barocco leccese”. È sede dell’Università del Salento. Nel 2015 è stata capitale italiana della cultura. Tra le chiese più importanti si ricordano il duomo, presentato in foto. La chiesa più rappresentativa del barocco leccese è la Basilica di Santa Croce. Tra i siti archeologici messapici si ricordano l’Ipogeo Palmieri, un’architettura funeraria rivenuta nel 1912. Tra i siti romani, invece, si ricordano l’Anfiteatro Romano, situato nella piazza centrale di Sant’Oronzo e il Teatro Romano, scoperto nel 1929 e utilizzabile dal 1999.', );
INSERT INTO `citta` (`id`, `nome`, `info`, `descrizione`, `immagine`) VALUES
(3, 'Otranto', 'premi 3 per ascoltare', 'Otranto è un comune della provincia di Lecce, città più orientale d’Italia ed il suo borgo è stato riconosciuto come patrimonio culturale dell’UNESCO. Nella Punta d’Otranto è edificato il faro ed è sede della stazione meteorologica di Otranto-Punta Palascia. La città si sviluppa attorno al castello aragonese e alla cattedrale normanna. Tra le aree naturali figurano soprattutto le spiagge, come la Baia dei Turchi, che tradizionalmente è considerata il luogo di sbarco dei guerrieri turchi durante l’assedio della città. L’immagine mostra la cava di Bauxite, composta da un laghetto, diverse piante paludose, ed una roccia rossastra. Essa si trova a sud di Otranto, presso la baia delle Orte, ed era utilizzata per estrarre la bauxite, minerale utile per ricavare l’alluminio.', );
INSERT INTO `citta` (`id`, `nome`, `info`, `descrizione`, `immagine`) VALUES
(4, 'Taranto', 'premi 4 per ascoltare', 'Taranto è uno dei capoluoghi della Puglia, nota per il suo Castello Aragonese sul mare e importante soprattutto per il suo porto; essa si trova a cavallo tra il mar Grande e mar Piccol. Fu una delle più importanti poleis della Magna Grecia ed infatti era un grande centro culturale, economico e militare. Da “Taranto” nacque il nome tarantismo, una sindrome isterica che anticamente era collegata al morso di un ragno; la guarigione avveniva tramite musica e danze (tarantella). In foto vi è il “ponte girevole” (ponte di San Francesco di Paola) attraversato da un vascello. Il ponte è in grado di aprirsi al passaggio delle navi. ', );
INSERT INTO `citta` (`id`, `nome`, `info`, `descrizione`, `immagine`) VALUES
(5, 'Ostuni', 'premi 5 per ascoltare', 'Ostuni è un comune della provincia di Brindisi, cui centro storico prende il nome di “Città Bianca” poiché dipinto interamente di calce bianca. Durante il paleolitico, l’area in cui oggi sorge Ostuni era già abitata. Infatti, nel 1991, venne rinvenuto uno scheletro risaliente a circa ventottomila anni fa. Si trattava di una donna ventenne e gravida che appoggiava la mano destra sul ventre, probabilmente per proteggere il feto. Nel territorio di Ostuni e Fasano è ubicato il parco naturale regionale Dune costiere da Torre Canne a Torre San Leonardo, un’area naturale protetta. Nell’immagine si può ammirare uno scorcio della Città Bianca.', );
INSERT INTO `citta` (`id`, `nome`, `info`, `descrizione`, `immagine`) VALUES
(6, 'Isole Tremiti', 'premi 6 per ascoltare', 'Le Isole Tremiti sono un comune della provincia di Foggia e l’arcipelago è composto dalle seguenti isole: San Nicola, San Domino, Capraia, Pianosa, Il Cretaccio, La Vecchia. L’arcipelago prende anche il nome di isole Diomedee, dall’eroe acheo Diomede che secondo il mito gettò tre sassi in mare e divenuti in seguito isole. Durante l’epoca fascista, gli oppositori politici vennero confinati sull’isola, tra i quali il Presidente della Repubblica Sandro Pertini. Per approfondire gli eventi storici, premere W (reindirizzamento verso Wikipedia: Isole Tremiti). In foto si possono ammirare le Isole nel mare Adriatico.', );
INSERT INTO `citta` (`id`, `nome`, `info`, `descrizione`, `immagine`) VALUES
(7, 'Alberobello', 'premi 7 per ascoltare', 'Alberobello è un comune della città metropolitana di Bari, caratteristico per i suoi trulli, un modello di architettura spontanea, dichiarati dal 6 dicembre 1996 Patrimonio mondiale dell’umanità dall’UNESCO. Molti trulli nacquero durante il quindicesimo secolo e ai contadini che dovettero costruirli venne imposto di utilizzare solo la pietra. Questa condizione costrinse i contadini a creare abitazioni di forma rotonda o quadrata, con una falsa cupola. Ciò diede l’aspetto caratteristico ai trulli. Uno dei più grandi trulli di Alberobello è chiamato Trullo sovrano. Altri luoghi di interesse sono le chiese, come la Chiesa Matrice. Nella foto vi sono alcuni trulli della città.', );
INSERT INTO `citta` (`id`, `nome`, `info`, `descrizione`, `immagine`) VALUES
(8, 'Polignano a Mare', 'premi 8 per ascoltare', 'Polignano a Mare è un comune della città metropolitana di Bari. l nucleo più antico della cittadina sorge su uno sperone roccioso a strapiombo sul mare Adriatico. Di interesse naturalistico sono le sue grotte marine; mentre di interesse storico vi sono il suo centro storico e i resti della dominazione romana, tra cui figura il ponte della via Traiana, tutt’ora percorribile. Dal 2008 Polignano a Mare ha sempre ricevuto la bandiera blu. Tra i siti si ricordano il sito di Santa Barbara, il sito di Madonna di Grottole, caratteristici per le grotte; altri siti sono la Torre Incina, la Piazza dell’Orologio, di origine medievale, e le varie chiese e l’Abbazia di San Vito. Tra i luoghi naturalistici vi è la Lama Monachile, raffigurata in foto. ', );
INSERT INTO `citta` (`id`, `nome`, `info`, `descrizione`, `immagine`) VALUES
(9, 'Castellana', 'premi 9 per ascoltare', 'Castellana Grotte è un comune della provincia di Bari, conosciuta soprattutto per il complesso carsico delle Grotte di Castellana. Le grotte vennero scoperto nel 1938, dando una “svolta turistica” alla cittadina: il suo nome, infatti, passò da Castellana a Castellana Grotte. La caverna principale è conosciuta come la “grave”, visibile in foto. Tale grotta è costituita da un grande “foro”, da cui passa la luce. La sua storia ha origine circa novanta milioni di anni fa, quando la Puglia era sommersa da un antico mare. La storia delle grotte non è ancora conclusa, poiché si pensa vi siano altre cavità nascoste. Di grande bellezza, oltre la grave, vi è la Grotta Bianca. Le grotte sono state anche scenari per ambienti cinematografici. Tra le architetture della città non mancano chiese antiche. ', );

